#Find the user with most word count in their message
#You have two lists, one with the name of senders, and the other with messages that they sent
#A user can appear more than once in the sender's list, since they can have sent more than one message
from typing import List
class Solution:
    def largestWordCount(self, messages: List[str], senders: List[str]) -> str:

        # creating a dictionary where I will put the names and the word count for each sender
        freq = {}
        for i in range(len(senders)):
            s = senders[i]
            m = messages[i]
            if s in freq:  # if the sender's name had already appeared in the list
                freq[s] += len(m.split())
            else:
                freq[s] = len(m.split())

        # creating the list with the wordcount winner

        max_count = float('-inf')  # represents the - infinity
        max_name = ''

        for s in freq:  # loop through the keys in freq. If I want the value instead of key, I would put "freq[s]"
            if freq[s] > max_count:
                max_count = freq[s]
                max_name = s

            elif freq[s] == max_count:
                lexi = [s, max_name]
                print(lexi)
                sorted_list = sorted(lexi, reverse=True)
                max_name = sorted_list[0]
                max_count = freq[max_name]

        return max_name, max_count

